Twitter doesn't care about people using their platform to commit fraud. I just reported an account  that's impersonating me. 
Hacking for pay services disguised as "account recovery."
@Twitter said it doesn't violate their policies. Oh well.

@orieisen The idea is to social distance. :-)))) That's why I bought this thing. Headed home to Vegas though. 
I pretty much bought it since I wasn't going to risk flying commercial from Florida. 
It will be useful for close proximity pentests I hope.

@HeyJude100 @WSJ I miss our traveling road shows!
I hope you are doing well.
#SweetHomeAlabama

